import React from 'react';
import '../../App.css';
import { Box, Divider } from "@material-ui/core";


function Home() {

    return (
        <div className = "homePage" id = "home">
            <img src = "/FOTOS/tela-main.png" alt = "foto VR" id = "foto-capa" />
            <Box id = "boxFrame">
                <h2>Eventos</h2>    
            </Box>
            <Divider />
            <Box id = "boxFrame1">

            </Box>
            <Divider />
            <Box id = "boxFrame2">
                <h2>Contate-nos</h2>
            </Box>
        </div>
    );
}

export default Home;
